function GetListData(){var n=$("#Id").val(),t=$("#Name").val(),i=$("#UserName").val(),r=$("#Email").val(),u=$("#PhoneNumber").val();return{Id:parseInt(n),Name:t,UserName:i,Email:r,PhoneNumber:u}}$("#btnSavePersonalInfo").click(function(){var n=GetListData(),t=$("#frmUserPersonalInfo").valid();t&&HttpPost(`/UserManagement/UpdatePersonalDetails`,"json",n,function(n){n[0]=="false"?WarningMessage(n[1]):SuccessMessage("Personal Data updated successfully.")})});